import user from "../ui/Userimg.png";

const StyledButton = styled.button`

   position: "absolute",
  left: "318px",
  top: "23px"
  cursor: pointer;
`;

function Button(props) {
    const { title, onClick } = props;

    return <StyledButton><img src={user} alt="my image" onClick={this.myfunction} /></StyledButton>
}

export default Button;
